import React from 'react';

export default function DatePickers({value}) {
  const classes = useStyles();

  return (
    <form className={classes.container} noValidate>
      <TextField
        id="date"
        label={value}
        type="date"
        defaultValue="YYYY-MM-DD"
        className={classes.textField}
        InputLabelProps={{
          shrink: true,
        }}
      />
    </form>
  );
}
